import React from "react";
import "./App.css";
import { Link } from "react-router-dom";

function Nav() {
  const navStyle = {
    color: "white",
  };

  const ACTIVE = { background: "#286090", color: "#fff" };

  return (
    <nav>
      <ul className="nav-links">
        <Link style={navStyle} to="/" activeStyle={ACTIVE}>
          <li>Home</li>
        </Link>
        <Link style={navStyle} to="/about">
          <li>About</li>
        </Link>
        <Link style={navStyle} to="/movies">
          <li>Movies</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
